import Particles from "react-tsparticles";

function App() {
  return (
    <Router>
      <Particles
        options={{
          background: { color: "#f0f4f8" },
          fpsLimit: 60,
          particles: {
            color: { value: "#888" },
            links: { enable: true, color: "#bbb", distance: 150 },
            movement: { speed: 1 },
            number: { value: 50 },
            opacity: { value: 0.2 },
            size: { value: { min: 1, max: 3 } },
          },
          detectRetina: true,
        }}
      />
      <Navbar />
      {/* ...pages */}
    </Router>
  );
}
export default App;
